import React from "react";
import Expense from "./Expense";

const List = ({ expenses }) => (
  <div className="gastos-realizados">
    <h2>Listado</h2>
    {expenses.map((expense) => (
      <Expense key={id} expense={expense} />
    ))}
  </div>
);
export default List;
